    "passive.coffee.md": {
      "path": "passive.coffee.md",
      "mode": "100644",
      "content": "Passives\n========\n\nPassives are abilities that are always in effect for a character.\n\n    module.exports = Passive = (I={}, self=Core(I)) ->\n\n    Passive.Passives =\n      Clairvoyance:\n        visionEffect: \"Clairvoyance\"\n\n      EagleEye:\n        visionType: \"magic\"\n\nTODO: Figure out creature type passives.\n\n      Undead:\n        immune: \"Death\"\n\n      Fireproof:\n        immune: \"Fire\"\n\n      Iceproof:\n        immune: \"Ice\"\n\n      Uncorrodible:\n        immune: \"Acid\"\n\n      FireTrail:\n        enter: \"Flame\"\n\n      AcidTrail:\n        enter: \"Acid\"\n\n      OilTrail:\n        enter: \"Oil\"\n\n      LeadFoot:\n        enter: \"Crush\"\n",
      "type": "blob"
    },
