      "content": "version: \"0.1.0\"\nwidth: 1024\nheight: 576\nremoteDependencies: [\n  \"https://code.jquery.com/jquery-1.10.1.min.js\"\n  \"https://cdnjs.cloudflare.com/ajax/libs/coffee-script/1.6.3/coffee-script.min.js\"\n  \"http://strd6.github.io/tempest/javascripts/envweb-v0.4.7.js\"\n]\ndependencies:\n  appcache: \"distri/appcache:v0.2.0\"\n  bit_array: \"distri/bit_array:v0.1.0\"\n  byte_array: \"distri/byte_array:v0.1.1\"\n  finder: \"distri/finder:v0.1.3\"\n  hotkeys: \"distri/hotkeys:v0.2.0\"\n  \"jquery-utils\": \"distri/jquery-utils:v0.2.0\"\n  priority_queue: \"STRd6/priority_queue:v2.0.0\"\n  quadtree: \"distri/quadtree:v0.1.1\"\n  random: \"distri/random:v0.2.0\"\n  runtime: \"STRd6/runtime:v0.2.0\"\n  sprite: \"distri/sprite:v0.2.0\"\n  \"touch-canvas\": \"distri/touch-canvas:v0.3.0\"\n",
