    "ability": {
      "path": "ability",
      "content": "(function() {\n  var Ability, COST_TYPE, Constants, Effect, TARGET_ZONE, binomial, indent, objectMap, sqrt, _ref;\n\n  sqrt = Math.sqrt;\n\n  binomial = require(\"random\").binomial;\n\n  objectMap = require(\"./lib/object_map\");\n\n  Effect = require(\"./effect\");\n\n  _ref = Constants = require(\"./ability_constants\"), COST_TYPE = _ref.COST_TYPE, TARGET_ZONE = _ref.TARGET_ZONE;\n\n  Ability = function(I, self) {\n    if (I == null) {\n      I = {};\n    }\n    if (self == null) {\n      self = Core(I);\n    }\n    Object.defaults(I, {\n      range: 1,\n      actionCost: 1,\n      cooldown: 0,\n      name: \"?\",\n      costType: COST_TYPE.FIXED\n    });\n    self.attrAccessor(\"actionCost\", \"actionType\", \"cooldown\", \"costType\", \"iconName\", \"name\", \"description\", \"range\", \"targetType\", \"targetZone\");\n    Object.extend(self, {\n      canPay: function(owner) {\n        return (owner.actions() >= self.actionCost()) && (owner.cooldown(self) === 0);\n      },\n      payCosts: function(owner) {\n        owner.setCooldown(self);\n        switch (self.costType()) {\n          case COST_TYPE.REST:\n            return owner.actions(0);\n          case COST_TYPE.FIXED:\n            return owner.actions(owner.actions() - self.actionCost());\n          default:\n            throw \"Unknown action cost type\";\n        }\n      },\n      compile: function() {\n        return Function(\"sqrt\", \"binomial\", CoffeeScript.compile(\"return ({animate, character, effect, feature, message, movementPath, owner, position, search}) ->\\n\" + (indent(I.code)), {\n          bare: true\n        }))(sqrt, binomial);\n      },\n      perform: function(params) {\n        var owner;\n        owner = params.owner;\n        self.payCosts(owner);\n        self.compile()(params);\n        return owner.resetTargetting();\n      }\n    });\n    return self;\n  };\n\n  Ability.Abilities = objectMap(require(\"./abilities\"), Ability);\n\n  Object.extend(Ability, Constants);\n\n  module.exports = Ability;\n\n  indent = function(text, indent) {\n    if (indent == null) {\n      indent = \"  \";\n    }\n    return text.replace(/^/gm, \"\" + indent);\n  };\n\n}).call(this);\n\n//# sourceURL=ability.coffee",
      "type": "blob"
    },
